// these data are for the input value for the 
// message form in the contacts page
export const inputvalues = [
  {
    el: 'input',
    type: 'text',
    placeholder: 'Full name *',
    background: 'user.png',
    name: 'name',
    value: ''
  },
  {
    el: 'input',
    type: 'email',
    placeholder: 'Email address *',
    background: 'envelop.png',
    name: 'email',
    value: ''
  },
  {
    el: 'input',
    type: 'text',
    placeholder: `Subject: Just sayin' hi!`,
    background: 'title.png',
    name: 'hi',
    value: ''
  },
  {
    el: 'textarea',
    placeholder: 'Message *',
    name: 'message',
    value: ''
  },
]
